import React from 'react';


function App() {
  return (
    <div className="d-flex flex-column">
      {/* Navbar */}
      <nav className="navbar navbar-expand-lg navbar-dark bg-primary">
        <div className="container-fluid">
          <span className="navbar-brand">Student Portal</span>
        </div>
      </nav>

      {/* Main Content */}
      <div className="container mt-4">
        <div className="row">
          {/* Sidebar */}
          <div className="col-md-3">
            <div className="list-group">
              <h4 className="text-center text-white mb-4">Dashboard</h4>
              <a href="#" className="list-group-item list-group-item-action">Home</a>
              <a href="#" className="list-group-item list-group-item-action">Courses</a>
              <a href="#" className="list-group-item list-group-item-action">Assignments</a>
              <a href="#" className="list-group-item list-group-item-action">Grades</a>
              <a href="#" className="list-group-item list-group-item-action">Settings</a>
              <a href="#" className="list-group-item list-group-item-action">Logout</a>
            </div>
          </div>

          {/* Main Content Area */}
          <div className="col-md-9">
            {/* Welcome Card */}
            <div className="card mb-4">
              <div className="card-header bg-primary text-white">
                Welcome, Student!
              </div>
              <div className="card-body">
                <h5 className="card-title">Your Dashboard</h5>
                <p className="card-text">Here is a quick overview of your academic details and progress.</p>
              </div>
            </div>

            {/* Courses */}
            <div className="card mb-4">
              <div className="card-header bg-primary text-white">
                Your Courses
              </div>
              <div className="card-body">
                <ul className="list-group">
                  <li className="list-group-item">Mathematics 101</li>
                  <li className="list-group-item">Physics 201</li>
                  <li className="list-group-item">Computer Science 301</li>
                </ul>
              </div>
            </div>

            {/* Assignments */}
            <div className="card mb-4">
              <div className="card-header bg-primary text-white">
                Pending Assignments
              </div>
              <div className="card-body">
                <ul className="list-group">
                  <li className="list-group-item">Mathematics Assignment - Due: 12/15</li>
                  <li className="list-group-item">Physics Lab Report - Due: 12/18</li>
                </ul>
              </div>
            </div>

            {/* Grades */}
            <div className="card mb-4">
              <div className="card-header bg-primary text-white">
                Your Grades
              </div>
              <div className="card-body">
                <table className="table table-striped">
                  <thead>
                    <tr>
                      <th>Course</th>
                      <th>Grade</th>
                    </tr>
                  </thead>
                  <tbody>
                    <tr>
                      <td>Mathematics 101</td>
                      <td>A</td>
                    </tr>
                    <tr>
                      <td>Physics 201</td>
                      <td>B+</td>
                    </tr>
                    <tr>
                      <td>Computer Science 301</td>
                      <td>A-</td>
                    </tr>
                  </tbody>
                </table>
              </div>
            </div>
          </div>
        </div>
      </div>

      {/* Footer */}
      <footer className="bg-dark text-white text-center p-3">
        <p>&copy; 2024 Student Portal. All rights reserved.</p>
      </footer>

      {/* Custom CSS */}
      <style>
        {`
          body{
            font-family: 'Arial', sans-serif;
            background-color: #f4f6f9;
            margin: 0;
          }

          .navbar {
            background-color: #3498db;
          }

          .navbar-brand {
            font-size: 24px;
            font-weight: bold;
          }

          .container {
            max-width: 1200px;
          }

          .card {
            border: none;
          }

          .card-header {
            background-color: #3498db;
            color: white;
          }

          .card-body {
            background-color: #ecf0f1;
          }

          .list-group-item {
            border: none;
          }

          .list-group-item:hover {
            background-color: #f1f1f1;
          }

          footer {
            background-color: #2c3e50;
            color: white;
          }

          footer p {
            margin: 0;
          }

          .text-white {
            color: white !important;
          }

          .bg-primary {
            background-color: #3498db !important;
          }
        `}
      </style>
    </div>
  );
}

export default App;
